Spotlight: @trap.heals founded by @iamdamonturner

Trap Heals is a creative agency and collective of artists based in South Central that focus on the intersection of art, culture and activism to cultivate community engagement and social equity. Through the use of visual art, brand development and creative strategy, we have collaborated with numerous non-profits, political movements and brands to reimagine culture and community healing.

